  return (
    <>
      <div className="flex flex-wrap">
        <Detail />
        <ProfileImage />
      </div>
    </>
  );
}

function Detail() {
  return (
    <>
      <span>Hi, I'm </span>
      <span className="text-3xl uppercase text-teal-600">Tepy</span>
      <p className="block">Frontend Developer</p>
    </>
  );
}

function ProfileImage() {
  return (
    <>
      <div className="p-8 rounded-full border-4 w-auto h-auto">
        <ProfileSvg />
      </div>
    </>
  );
}

export default Profile;
